import { createTheme } from '@mui/material/styles';

const theme = createTheme({
  palette: {
    primary: {
      main: '#FB37A3',
    },
    secondary: {
      main: '#FD9DD1',
    },
    info: {
        main: '#FFFFFF'
    }
  },

  components: {
    MuiMenu: {
      variants: [
        {
          style: {
            backgroundColor: 12,
          },
        },
      ],
    },
  },
  

});

export default theme;
